	private static int RND_INDX = (int)(Math.random()*1024);
	
	public static double sin(double theta){
		while(theta < 0) theta += TAU;
		theta %= TAU;
		int index = (int)Math.round(theta*100);
		return SINE[index];
	}
	
	public static double cos(double theta){
		while(theta < 0) theta += TAU;
		theta %= TAU;
		int index = (int)Math.round(theta*100);
		return COSINE[index];
	}
	
	// PSEUDO RNG
	// Returns random loat between 0.0-1.0
	public static double random(){ return RANDOM[(++RND_INDX)%1024]; }
	
	// Returns random integer between 0-256
	public static int randomInt(){ return RANDOM_INT[(++RND_INDX)%1024]; }

	// Returns random boolean value
	public static boolean randomBoolean(){ return RANDOM_BOOL[(++RND_INDX)%1024]; }
	
	// Returns random angle between 0-2pi
	public static double randomAngle(){ return RANDOM[(++RND_INDX)%1024]*TAU; }
	
	public static Color mix(Color A, Color B, double ratio){
		double ka = ratio;
		double kb = 1-ratio;
		int r = (int)(A.getRed()*ka + B.getRed()*kb);
		int g = (int)(A.getGreen()*ka + B.getGreen()*kb);
		int b = (int)(A.getBlue()*ka + B.getBlue()*kb);
		int a = (int)(A.getAlpha()*ka + B.getAlpha()*kb);
		return new Color(r,g,b,a);
	}
	
	public static Color darken(Color color, double amount){ return mix(Color.black,color,amount); }
	public static Color brighten(Color color, float amount){ return mix(Color.white, color,amount); }
	
